// \u516C\u53F8A\u7EE9\u6548\u8BA1\u7B97\u65B9\u5F0F
const companyA = {
	S(salary) {
		return salary * 4
	},
	A(salary) {
		return salary * 3
	},
	B(salary) {
		return salary * 2
	},
}
// \u516C\u53F8B\u7EE9\u6548\u8BA1\u7B97\u65B9\u5F0F
const companyB = {
	S(salary) {
		return salary * 7
	},
	A(salary) {
		return salary * 6
	},
	B(salary) {
		return salary * 5
	},
}

// \u6839\u636E \u516C\u53F8/\u7EE9\u6548/\u57FA\u672C\u5DE5\u8D44 \u8BA1\u7B97\u6700\u7EC8\u85AA\u6C34,\u800C\u8FD9\u4E09\u4E2A\u8981\u7D20\u5747\u53EF\u66FF\u6362
const calculate = (company, level, salary) => {
	return company[level](salary)
}

